    const [input,setinput]= useState("")
const {handleSearch,MovieData}= props


    
    

    const  handleChange=(e)=>{
        let value= e.target.value
       /// setinput(value)
     
       
        setinput(value)
       //console.log(responseData);
    

    }
  
  return (
    <div className='Nav'>
           <div className='Search'>    <input type = "textbar" placeholder='Search for Movies' onChange={handleChange}value={input} />
          <button onClick ={(e)=>handleSearch(e,input)}>Search</button></div>
          
     
    </div>
  )
}
